script: |
  super -f text -I q9946.spq | sort > q9946.out

inputs:
  - name: q9946.spq
    data: |
      SELECT DISTINCT + col1 AS col1 FROM tab2 (FORMAT parquet) cor0 WHERE NOT col1 * + + col1 / - + 42 >= + ( col1 ) * + 36;
  - name: tab2

outputs:
  - name: q9946.out
    data: |
      51
      67
      77
